import { Outlet } from "react-router-dom";
import Navbar from "../components/NavBar";
import Footer from "../components/Footer";


const proviamo = {

    parametri: {
    id: 39,
    nome: 'francia'    
    },

    datiIniziali: {
    via: 'roma 23',
    citta: 'milano'    
    },

    response: [
    {
    lega:{
    id: '39',
    nome: 'ligue one',
    seasons: '2019',
    standings: [
    [
    {
    rank: 1,
    team:{ id: 40, nome: 'liverpool'}, 
    points: 70,
    all: {played: 24, win: 16, draw: 4, lose: 4, goals:{ for: 85, against: 15} }     
    },
    {
        rank: 1,
        team:{ id: 30, nome: 'roma'}, 
        points: 70,
        all: {played: 24, win: 16, draw: 4, lose: 4, goals:{ for: 25, against: 15} }     
        },
        {
            rank: 1,
            team:{ id: 10, nome: 'lazio'}, 
            points: 70,
            all: {played: 24, win: 16, draw: 4, lose: 4, goals:{ for: 75, against: 15} }     
            },
            {
                rank: 1,
                team:{ id: 22, nome: 'atalanta'}, 
                points: 70,
                all: {played: 24, win: 16, draw: 4, lose: 4, goals:{ for: 65, against: 15} }     
                }
    ]   
    ]
    }    
    }    
    ]

}



 const filtrapiugol = proviamo.response.lega.standings.filter(goal => goal.all.goals.for > 65)

if(filtrapiugol.length > 0 ){
console.log(filtrapiugol, 'filtraggio riuscito')    
}else{
console.log('nessun elemento filtrato')    
}

const RootPage = () => {

return(
<div>
<Navbar></Navbar>
<Outlet></Outlet>
<Footer></Footer>
</div>
)};

export default RootPage;
